const getImg = (options) => {
    const param = getQueryParameters(options)
    console.log('queryParameters', param)

    const pageSize = parseInt(param.pageSize)
    const pageIndex = parseInt(param.pageIndex)
    const viewMode = parseInt(param.viewMode)

    var imgs2 =
        viewMode === 0 ? imgs
        : viewMode === 1 ? imgs.filter(item => !item.isLock)
        : viewMode === 2 ? imgs.filter(item => item.isLock) : imgs

    // 图片尺寸可供选择：square、thumb150、orj360、orj480、mw690、mw1024、mw2048、small、bmiddle、large
    // https://tva2.sinaimg.cn/large/005Q9Qt9ly1gzrhfaic3gj31hc0u0qed.jpg
    const data = []
    for (let i = pageSize * pageIndex; i < pageSize * (pageIndex + 1) && i < imgs2.length; i++) {
        // const num = parseInt(Math.random() * imgs.length, 10)
        // const tva = parseInt(Math.random() * 4 + 1, 10)

        // const num = Mock.mock('@integer(1, ' + (imgs2.length - 1) + ')')
        const tva = Mock.mock('@integer(1, 4)')

        data.push(Mock.mock({
            id: '@id',
            title: '@ctitle(8)',
            isCheck: false,
            isLock: imgs2[i].isLock,
            createdTime: '@datetime',
            like: '@integer(0,999999)',
            src: 'https://tva' + tva + '.sinaimg.cn/bmiddle/' + imgs2[i].pid + '.jpg',
            dataSource: 'https://tva' + tva + '.sinaimg.cn/large/' + imgs2[i].pid + '.jpg'
        }))
    }

    return builder(data)
}

Mock.mock(/\/api\/images/, 'get', getImg)
